import React,{useState} from 'react';

const Landing = () => {
    const [active, setActive] = useState("white")
    const tabList = [ 
        {
            name: 'Home',
            label:'Home',
        },
        { 
            name: 'Collections',
            label:'Collections',
        },
        { 
            name: 'About us',
            label:'About us',
        },
        { 
            name: 'Refunds & returns',
            label:'Refunds & returns',
        },
        { 
            name: 'Everything and Afrithings',
            label:'Everything and Afrithings',
        },
    ]
    let SelectItem = 
    <div
        style={{
            position:"fixed",
            top:"5vh",
            left:"15vw",
            background:"black",
            width:"60vw",
            height:"20vh"
        }}
    >
    {
            tabList.map((tab, i) => (

                <button 
                key={i}
                style={{
                    position:"relative",
                    textTransform:"none",
                    height:"3vh",
                    top:"1vh",
                    border:"none",
                    borderRadius:"2px",
                    display:"flex",
                    color:active === i ? "white" :"black",
                    background:"white",
                    marginLeft:"5vw",
                    float:"left"
                }}>
                    {tab.label}
                </button>
            ))
    }
    </div>
    return(
        <div>
            {SelectItem}
        </div>
    )
}
export default Landing;
